import Square from "./components/Square";

export default function Board(props) {
    function constructBoard(length, height) {
        const row = new Array(length).fill(false);
        const column = new Array(height).fill(row);

        return console.log("Row: "+row+" Column: "+column);
    }

    return console.log("Row: "+row+" Column: "+column);
}
